import { Navbar, Container } from "react-bootstrap";
import logoUmpa from "../../assets/images/logo-umpa-loompa.png";

const NavBar = () => {
  return (
    <>
      <Navbar bg="light">
        <Container>
          <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Container>
      </Navbar>
    </>
  );
};

export default NavBar;
